import React, { Component } from 'react';
import './ComfirmPage.css';

class ComfirmPage extends Component {
    render() {
        return (
            <div>
                <div className='mainPage'>
                    <div className='infoBox'>
                        <p className='title'>Congratulations!</p>

                    </div>
                </div>
            </div>
        );
    }
}

export default ComfirmPage;
